Variables assessed before message exposure include:
●	Eating habits (7 items; adapted from Hoek et al., 2011);
Variables assessed immediately after message exposure include:
●	Willingness towards meat substitution (3 items; Graça et al., 2016);
●	HAPA items developed based on the online HAPA guidelines (Schwarzer, Sniehotta, Lippke, Luszczynska, Scholz, Schüz, Wegner, Ziegelmann, 2003) relating to Motivation, i.e., Risk Perception (6 items), Outcome Expectancies (4 items) and Intention (3 items).
Variables assessed one week after message exposure include:
●	Self-reported eating habits over the previous week (7 items; adapted from Hoek et al., 2011);
●	HAPA items developed based on the online HAPA guidelines (Schwarzer, Sniehotta, Lippke, Luszczynska, Scholz, Schüz, Wegner, Ziegelmann, 2003) pertaining to Capacitation, i.e., Action Self-Efficacy (3 items), Action Planning (3 items), Coping Planning (3 items), Coping Self-Efficacy (3 items), Recovery self-efficacy (3 items) and Self-Monitoring (3 items).

Additional measures that will be used in exploratory analyses (see point 24) include: psychological reactance, affect, threat construal, meat attachment, attitudes, prevalence of plant-based eating in social network, and message credibility and clarity.

